import React from 'react'
import "./projet.css"

export default function Projet() {
  return (
    <div className='ContainerProjet'>
        <h1 className='titreProjet'>Mes projets</h1>
        <p className='introProjet'>"Passionné de web design, j'ai fais mes gammes avec du css et du javascript natif. Puis, j'ai utilisé quelque librairies telles que jquerry ou bootstrap. Enfin, grâce à ma formation j'utilise désormais le framework bootstrap"</p>
    </div>
  )
}
